import React from "react";

export default function Listbook(props) {
  const rating = {
    1: `<i class="fas fa-star"></i>`,
    2: `<i class="fas fa-star"></i><i class="fas fa-star"></i>`,
    3: `<i class="fas fa-star"></i><i class="fas fa-star"></i><i class="fas fa-star"></i>`,
    4: `<i class="fas fa-star"></i><i class="fas fa-star"></i><i class="fas fa-star"></i><i class="fas fa-star"></i>`,
  };
  return props.result.map(function (result, index) {
    return (
      <div class="card list-book">
        <h5 class="card-header card-title">
          {result.title} - {result.author}
        </h5>
        <div class="card-body">
          <p class="card-text">
            <i class="fas fa-star"></i>
            <i class="fas fa-star"></i>
            <i class="fas fa-star"></i>
            <i class="fas fa-star"></i>
          </p>
          <p class="card-text">{result.comments}</p>
        </div>
      </div>
    );
  });
}
